import 'bootstrap/dist/css/bootstrap.min.css';
import required_ics from '../assets/icsrequirements';

const Requirements = () => {
    let count = 0;
    console.log(required_ics[count])

    function check_tag(course)
    {
        console.log(course)
        count += 1;
        if(required_ics[course])
        {
            return <li key={count}>{course}</li>
        }
        return <h3 key={count}>{required_ics[course]}</h3>
    }
    return (
        <ul>
            {required_ics.map((item) => (
                check_tag(item)
            ))}

        </ul>
    )
}

export default Requirements
